import React from 'react';
import SideDrawer from '../SideDrawer';
import './MainDrawer.css';

export default class MainDrawer extends React.Component {
    constructor(props){
        super(props);
        let drawerType;
        this.props = {drawerType}
    }
    render(){
        return (
            <nav className={this.state.drawerClasses}>
                <div className="company-name">
                    KralCo
                </div>
                <ul>
                    <li><button onClick={SideDrawer.sendCoins}>Send Coins</button></li>
                    <li><button onClick={SideDrawer.receiveCoins}>Receive Coins</button></li>
                    <li><button onClick={SideDrawer.changeWallet}>Change Wallet</button></li>
                    <li><button onClick={SideDrawer.changeNetwork}>Change Network</button></li>
                </ul>
            </nav>
        )
    }
}
